		ValidGraphicsP[],
		Messages:>{Warning::DownsampledDataNotPartOfDataObject}
	],
	Example[{Messages,"DataFormat","Error and return $Failed if for some reason the linked Downsampled data file does not resolve to a sparse array:"},
		PlotChromatographyMassSpectra[
