		$Failed,
		Messages:>{Error::DataFormat,Error::InvalidInput}
	],
	Example[{Messages,"InvalidDataDimensions","Error and return $Failed if for some reason the linked Downsampled data file has inconsistent dimensions with its sampling points:"},
		PlotChromatographyMassSpectra[
			Object[Data,ChromatographyMassSpectra,"Object with invalid downsampled data dimensions for Unit Testing"]
		],
		$Failed,
		Messages:>{Error::InvalidDataDimensions,Error::InvalidInput}
	],

