				Name->"Old object with no downsampling for Unit Testing",
				Type->Object[Data,ChromatographyMassSpectra],
				DateCreated->(Now-2*Day),
				DeveloperObject->True
			|>,
			<|
				Name->"New object with no downsampling for Unit Testing",
				Type->Object[Data,ChromatographyMassSpectra],
				DateCreated->Now,
				DeveloperObject->True
			|>,
			<|
				Name->"Object with invalid downsampling file for Unit Testing",
				Type->Object[Data,ChromatographyMassSpectra],
				DateCreated->Now,
				DeveloperObject->True
			|>,
			<|
				Name->"Object with invalid downsampled data dimensions for Unit Testing",
				Type->Object[Data,ChromatographyMassSpectra],
				DateCreated->Now,
				DeveloperObject->True
			|>
		}];

		(* Create bad cloud files for testing *)
		badFile=With[
			{file=Export[FileNameJoin[{$TemporaryDirectory,"dummyText.txt"}],"Hello World!","Text"]},
			UploadCloudFile[file]
		];
		badDimFile=With[
			{file=Export[FileNameJoin[{$TemporaryDirectory,"dummyText.mx"}],SparseArray[ConstantArray[1.0,{140,140}]],"MX"]},
			UploadCloudFile[file]
		];

		Upload[{
			<|
				Name->"Bad dimension downsample for Unit Testing",
				Type->Object[Analysis,Downsampling],
				DownsampledDataFile->Link@badDimFile,
				Replace[DataUnits]->{Minute,Dalton,ArbitraryUnit},
				NoiseThreshold->100,
				Replace[SamplingGridPoints]->{{1,100,1},{1,100,1},Null},
				Replace[Reference]->Link[o4,DownsamplingAnalyses],
				DateCreated->Now,
				DeveloperObject->True
			|>,
			<|
				Name->"Invalid cloudfile downsample for Unit Testing",
				Type->Object[Analysis,Downsampling],
				DownsampledDataFile->Link@badFile,
				Replace[DataUnits]->{Minute,Dalton,ArbitraryUnit},
				NoiseThreshold->100,
				Replace[SamplingGridPoints]->{{1,100,1},{1,100,1},Null},
				Replace[Reference]->Link[o3,DownsamplingAnalyses],
				DateCreated->Now,
				DeveloperObject->True
			|>,
			<|
				Name -> "Test object 1 for acquisition mode Unit Testing",
				Type -> Object[Data, ChromatographyMassSpectra],
				Replace[AcquisitionModes] -> {DataDependent, MultipleReactionMonitoring}
			|>,
			<|Name -> "Test object 2 for acquisition mode Unit Testing",
				Type -> Object[Data, ChromatographyMassSpectra],
				Replace[AcquisitionModes] -> {DataIndependent, DataDependent,	MultipleReactionMonitoring}
			|>
		}]
	]
),

SymbolTearDown:>Module[{objsToErase},
	objsToErase=Flatten[{
		$CreatedObjects,
		Object[Data,ChromatographyMassSpectra,"Old object with no downsampling for Unit Testing"],
		Object[Data,ChromatographyMassSpectra,"New object with no downsampling for Unit Testing"],
		Object[Data,ChromatographyMassSpectra,"Object with invalid downsampling file for Unit Testing"],
		Object[Data,ChromatographyMassSpectra,"Object with invalid downsampled data dimensions for Unit Testing"],
		Object[Analysis,Downsampling,"Bad dimension downsample for Unit Testing"],
		Object[Analysis,Downsampling,"Invalid cloudfile downsample for Unit Testing"],
		Object[Data, ChromatographyMassSpectra,	"Test object 1 for acquisition mode Unit Testing"],
		Object[Data, ChromatographyMassSpectra,	"Test object 2 for acquisition mode Unit Testing"]
	}];

	EraseObject[
		PickList[objsToErase,DatabaseMemberQ[objsToErase]],
		Force->True,
		Verbose->False
	];
]

];
